  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Browns
  Park NWR outlines Refuge accomplishments during the 1994 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. The report
  includes a planning section which discusses management planning. Refuge administration
  is outlined; information about personnel, volunteer programs, funding, safety, and
  technical assistance is given. Habitat management is also covered; subjects include
  wetlands, forests, grasslands, grazing, fire management, pest control, water rights,
  and wilderness areas. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, fisheries resources, wildlife propagation, animal control,
  and marking and bird banding. The public uses of the Refuge described in this report
  include interpretive programs, hunting, fishing, wildlife observation, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, equipment replacement, communication
  systems, computer systems, and energy conservation. Cooperative programs and items
  of interest are provided at the end. Refuge brochures are attached.\",\n\t\"owner_org\":
